package practice.medium;

import java.util.*;

public class findAnagrams {
    public static void main(String[] args) {
        String s = "";
        String p = "";
        List<Integer>res = findAnagrams(s, p);
        for(int r : res){
            System.out.print(r);
        }
    }

    public static List<Integer> findAnagrams(String s, String p) {
        HashMap<Character,Integer> map = new HashMap<>();
        HashMap<Character,Integer> tmp = new HashMap<>();
        List<Integer>res = new LinkedList<>();
        char[] parray = p.toCharArray();
        char[] sarray = s.toCharArray();
        for(char pc : parray){
            map.put(pc,map.getOrDefault(pc,0)+1);
        }
        int count = map.size();
        int left = 0;
        int right = 0;
        while(right < s.length()){
            char tmpChar = sarray[right];
            right++;
            tmp.put(tmpChar, tmp.getOrDefault(tmpChar,0)+1);
            if(tmp.get(tmpChar).equals(map.getOrDefault(tmpChar,0))){
                count--;
                if(count ==0){
                    res.add(left);
                }
            }

            while((right - left+1) > p.length()){
                char leftChar = sarray[left];
                left++;
                if(map.containsKey(leftChar)){
                    if(tmp.get(leftChar).equals(map.get(leftChar))){
                        count++;
                    }
                    tmp.put(leftChar,tmp.get(leftChar)-1);
                }
            }
        }
        return res;
    }
}
